import logo from './logo.svg';
import { Route } from 'react-router-dom';
import About from'./Page/About.js';
import Home from './Page/Home.js';

import './App.css';

const App = () =>{
  return(
      <div>
          <Route path="/" component={Home}/>
          <Route path="/about" component={About}/>
      </div>
  )
}

export default App;
